@scenarieconomic Se il M5S approva una roba del genere il governo deve cadere IMMEDIATAMENTE e si deve tornare a elezioni.

Guai guai guai soprassedere a una roba del genere.

Confidiamo e diamo fiducia al Comandante della nave Italia in questa tempesta Cap. Matteo Salvini, quella roba NON PASSI!
